import React from "react";
import { View, TextInput, Button } from "react-native";

const CreatePost = () => {
  return (
    <View>
      <TextInput placeholder="Title" />
      <textarea placeholder="Content"/>
      <Button title="S"/>
    </View>
  );
};

export default CreatePost;
